           <h2><?=(_("Викинги Вирумаа"));?><small><?=(_("Братство ролевиков"));?><br/><?=(_("и исторических реконструкторов"));?></small></h2>
            <p class="text-center">
                <a class="btn btn-social-icon btn-sm btn-vk" href="http://vk.com/viruviking" style="border-radius:15px;"><i class="fa fa-vk"></i></a>
                <a class="btn btn-social-icon btn-sm btn-facebook" href="http://fb.com/viruviking" style="border-radius:15px;margin-left:2px;"><i class="fa fa-facebook"></i></a>
                <a class="btn btn-social-icon btn-sm btn-google"  href="http://plus.google.com/+ViruvikingClub" style="border-radius:15px;margin-left:2px;"><i class="fa fa-google"></i></a>
                <a class="btn btn-social-icon btn-sm btn-instagram"  href="https://www.instagram.com/viruviking/" style="border-radius:15px;margin-left:2px;"><i class="fa fa-instagram"></i></a>
            </p>

        </div></div></div></div></div></div></div>
        <div class="container vv_intro"><div class="row"><div class="col-md-6 col-lg-6">
        <h2><?=(_("Братство Викингов Вирумаа объединяет молодежь, интересующуюся ролевыми играми живого действия и исторической реконструкцией."));?></h2><h3><?=(_("Мы проводим тренировки по историческому фехтованию, изготавливаем исторические и ролевые костюмы, участвуем в полевых ролевках и организуем собственные игры."));?></h3>
        <p><?=(_("LARP и историческая реконструкция — весьма интересное и достойное хобби. Вместе участники сообщества изучают историю, тренируются, учатся полезным жизненным навыкам выживания в суровых природных условиях без некоторых вещей. Они воспитывают в себе выдержку, волю, характер. Девушки приобретают навыки шитья, учатся готовить блюда, соответствующие отыгрываемой исторической эпохе."));?></p>
        </div>
        <div class="hidden-xs hidden-sm col-md-6 col-lg-6"><h2><?=(_("Приходите на тренировки<br>по историческому фехтованию!"));?></h2><h3><?=(_("Мы тренируемся на одноручных и двуручных мечах, приобретаем навыки использования щита в бою. Историческое фехтование — это незабываемый опыт и активный отдых в компании интересных людей. Каждый бой — словно встреча персонажей из древних преданий и легенд."));?></h3>
        <p><?=(_("Тренировки проводятся на любительском уровне. Изучение приёмов осуществляется на тренировочном снаряжении, приближенном к боевому. Контактные бои проводятся на гуманизированном оружии."));?></p>
        <p><?=(_("Пробное занятие - бесплатное, новичкам предоставляются тренировочные снаряды."));?></p>
        <p class="viruviking_proov"><a class="btn btn-social btn-vk" href="https://vk.me/viruviking"><span class="fa fa-vk"></span>&nbsp;<?=(_("Регистрация"));?></a><small><?=(_("Регистрация осуществляется посредством<br/>инфосистемы Йомсборг."));?></small></p>
        </div></div></div>
        <div class="container adv_training_image hidden-md hidden-lg"><div class="row"></div></div>
        <div class="container adv_training_main hidden-md hidden-lg"><div class="row">
        <div class="col-xs-12"><h2><?=(_("Приходите на тренировки<br>по историческому фехтованию!"));?></h2><h3><?=(_("Мы тренируемся на одноручных и двуручных мечах, приобретаем навыки использования щита в бою. Историческое фехтование — это незабываемый опыт и активный отдых в компании интересных людей. Каждый бой — словно встреча персонажей из древних преданий и легенд."));?></h3>
        <p><?=(_("Тренировки проводятся на любительском уровне. Изучение приёмов осуществляется на тренировочном снаряжении, приближенном к боевому. Контактные бои проводятся на гуманизированном оружии."));?></p>
        <p class="viruviking_proov"><a class="btn btn-social btn-vk" href="https://vk.me/viruviking"><span class="fa fa-vk"></span>&nbsp;<?=(_("Регистрация"));?></a><small><?=(_("Регистрация осуществляется посредством<br/>инфосистемы Йомсборг."));?></small></p>
